/**
 * handle an animation
 *
 * @name tQuery.Animation
 * @class
*/
tQuery.register('Animation', function(){
	this._keyframes		= new Array;
	this._totalTime		= null;
	this._onUpdate		= null;
	this._onCapture		= function(position){};
	this._initialPos	= {};
	this._propertyTweens	= {};
});


/**
 * Destructor
*/
tQuery.Animation.prototype.destroy	= function(){
	this.stop();
};	


